import{_ as e,o as t,c as o,O as r}from"./chunks/framework.9482e208.js";const f=JSON.parse('{"title":"§ 53.1-77 Jurisdiction of judge or magistrate of adopting county or city authorized to issue temporary detention orders.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/53.1-77.md","filePath":"vacode/53.1-77.md"}'),a={name:"vacode/53.1-77.md"},i=r('<h1 id="§-53-1-77-jurisdiction-of-judge-or-magistrate-of-adopting-county-or-city-authorized-to-issue-temporary-detention-orders" tabindex="-1">§ 53.1-77 Jurisdiction of judge or magistrate of adopting county or city authorized to issue temporary detention orders. <a class="header-anchor" href="#§-53-1-77-jurisdiction-of-judge-or-magistrate-of-adopting-county-or-city-authorized-to-issue-temporary-detention-orders" aria-label="Permalink to &quot;§ 53.1-77 Jurisdiction of judge or magistrate of adopting county or city authorized to issue temporary detention orders.&quot;">​</a></h1><p>When the jail of any other county or city has been adopted or designated under the provisions of §§ <a href="http://law.lis.virginia.gov/vacode/53.1-74/" target="_blank" rel="noreferrer">53.1-74</a> and <a href="http://law.lis.virginia.gov/vacode/53.1-76/" target="_blank" rel="noreferrer">53.1-76</a>, any judge or magistrate authorized to issue temporary detention orders pursuant to §§ <a href="http://law.lis.virginia.gov/vacode/37.2-809/" target="_blank" rel="noreferrer">37.2-809</a> through <a href="http://law.lis.virginia.gov/vacode/37.2-813/" target="_blank" rel="noreferrer">37.2-813</a> of the adopting county or city shall have concurrent jurisdiction with those of the county or city wherein the adopted or designated jail is located, in proceedings under Chapter 8 (§ <a href="http://law.lis.virginia.gov/vacode/37.2-800/" target="_blank" rel="noreferrer">37.2-800</a> et seq.) of Title 37.2, with respect to such persons as have been involuntarily admitted there from the adopting county or city. Such judge or magistrate may perform any such act or duty at such place as if such person was involuntarily admitted within the jurisdiction of the adopting county or city.</p><p>Code 1950, § 53-142.1; 1952, c. 264; 1970, c. 648; 1982, c. 636; 2005, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0716" target="_blank" rel="noreferrer">716</a>.</p>',3),n=[i];function d(s,c,u,h,l,g){return t(),o("div",null,n)}const _=e(a,[["render",d]]);export{f as __pageData,_ as default};
